import React, { useState } from 'react';
import { useRef } from 'react';

import avatar from '../img/avatar.png';

import Goldy from '../img/projects/goldy1.png';
import Goldy_ from '../img/projects/goldy2.png';

import ArrowRightRoundedIcon from '@mui/icons-material/ArrowRightRounded';

const Works = () => {
    const [ activeIndex, setActiveIndex ] = useState(null);
    const scrollableDivRef = useRef(null);

    const toggleDiv = (index) => {
        if (activeIndex === index) {
            setActiveIndex(null);
        } else {
            setActiveIndex(index)
        }
    };

    const handleScroll = (event) => {
        const { current } = scrollableDivRef;
        if (
            current &&
            current.scrollTop !== 0 &&
            current.scrollTop + current.clientHeigh !== current.scrollHeight
        ) {
            event.stopPropagation();
        }
    };

    return (
        <div className="h-full flex-grow grid grid-cols-4 overflow-y-scroll scrollbar p-10 py-20 gap-2">
            <div className="p-2">
                <div className="flex flex-col gap-4">
                    <button
                        onClick={() => toggleDiv(0)}
                        className="bg-blue-100/50 shadow hover:shadow-md py-2 rounded-lg flex flex-col items-center"
                    >
                        <span class="material-symbols-outlined">
                            chat
                        </span>
                        Goldy
                    </button>

                    <button
                        onClick={() => toggleDiv(1)}
                        className="bg-blue-100/50 shadow hover:shadow-md py-2 rounded-lg flex flex-col items-center"
                    >
                        <span class="material-symbols-outlined">
                            social_leaderboard
                        </span>
                        Ascension
                    </button>

                    <button
                        onClick={() => toggleDiv(2)}
                        className="bg-blue-100/50 shadow hover:shadow-md py-2 rounded-lg flex flex-col items-center"
                    >
                        <span class="material-symbols-outlined">
                            sign_language
                        </span>
                        Braille-to-Audio Translation Gloves
                    </button>

                </div>
            </div>

            <div
                className="col-span-3 rounded-xl bg-gray-50 shadow h-fit overflow-y-scroll scrollbar"
            >
                <div className="p-4 px-16" style={{ display: showDiv[0] ? 'block' : 'none' }}>
                    <div className=' py-2'>
                        <img src={Goldy} className='rounded-lg shadow' />
                    </div>

                    <p className='font-semibold text-center'>Goldy: An NLP-Based Chatbot for English Learning in Elementary Education</p>
                    <p>
                        Team: 2 members
                    </p>
                    <p>
                        Role: Fullstack Developer
                    </p>
                    <p>
                        Duration: 10 months
                    </p>
                    
                    <button className='text-sm hover:font-bold'>
                        View more
                        <ArrowRightRoundedIcon />
                    </button>
                </div> {/* goldy */}

                <div className="p-4 px-16" style={{ display: showDiv[1] ? 'block' : 'none' }}>
                    <div className=' py-2'>
                        <img src={Goldy} className='rounded-lg shadow' />
                    </div>

                    <p className='font-semibold text-center'>Ascension: Gamification of Academic Programs</p>
                    <p>
                        Team: 14 members
                    </p>
                    <p>
                        Role: Front-End Developer
                    </p>
                    <p>
                        Duration: 1 month
                    </p>

                    <button className='text-sm hover:font-bold'>
                        View more
                        <ArrowRightRoundedIcon />
                    </button>
                </div> {/* ascension */}

                <div className="p-4 px-16" style={{ display: showDiv[2] ? 'block' : 'none' }}>
                    <div className=' py-2'>
                        <img src={Goldy} className='rounded-lg shadow' />
                    </div>

                    <p className='font-semibold text-center'>Braille-to-Audio Translation Glove</p>
                    <p>
                        Role: Python Developer
                    </p>
                    <p>
                        Duration: 48hrs
                    </p>

                    <button className='text-sm hover:font-bold'>
                        View more
                        <ArrowRightRoundedIcon />
                    </button>
                </div> {/* braille */}
            </div>

        </div>
    );
};

export default Works;
